    function setPose(){

		//,0.1 ,0.100
		console.log("set pose");
		var skeletonPose = window.sceneController.skeletonPose;
		skeletonPose.joints["Root"].setTranslation([1521.0 , 1067.0, 85.0 ]);////
		//skeletonPose.joints["Root"].setRotation([0,0,0,1]);
		skeletonPose.joints["Root"].setRotation([0, -0.716172, 0, 0.697923]);
